import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a category to get to product listing page
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for price filter to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Fill in price range inputs
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '200');

    // Take screenshot after filling price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_range_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_range_filled.png'));

    // Click apply filter button
    await page.click('.apply-filter');

    // Wait for results to update
    await page.waitForSelector('.products-grid', { timeout: 5000 });

    // Take final screenshot after filter applied
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract some product data to verify filter worked
    const productPrices = await page.$$eval('.product-price', prices => 
      prices.map(p => p.textContent.trim())
    );

    return {
      success: true,
      action: "Applied price range filter ($50-$200) to Electronics category",
      extractedData: {
        filteredProductsCount: productPrices.length,
        samplePrices: productPrices.slice(0, 3)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
